(670, 'course_desc', 52, 'tw', '【課程大綱】\r\n1.設定目標的指導原則\r\n2.瞭解目標設定的要素\r\n3.讓團隊的成員參與設定目標\r\n4.目標設定的績效檢核指標\r\n5.工作目標分解的策略與規劃'),
