(1420, 'competency_definition', 95, 'tw', '能正確同理他人的感受、需要和觀點，並能清楚表達自己的語意讓對方明瞭；以及具備「對上下與同儕進行工作說明，以達成目標結果，協調過程中，能隨時做出適當反應與改善」的能力。'),
(1421, 'competency_definition', 95, 'cn', ''),
(1422, 'competency_definition', 95, 'en', ''),
(1423, 'competency_definition', 96, 'tw', '能與內外部顧客建立並維持友善的關係或聯繫網絡。'),
(1424, 'competency_definition', 96, 'cn', ''),
(1425, 'competency_definition', 96, 'en', ''),
(1426, 'competency_definition', 97, 'tw', '指將顧客的需要視為第一要務；與顧客建立及維持良性的互動關係。'),
(1427, 'competency_definition', 97, 'cn', ''),
(1428, 'competency_definition', 97, 'en', ''),
(1429, 'competency_definition', 98, 'tw', '能夠影響、塑造部門單位或團隊成員正向的態度與行為；能夠激發並引導部門單位或團隊成員達成預定的目標。'),
(1430, 'competency_definition', 98, 'cn', ''),
(1431, 'competency_definition', 98, 'en', ''),
(1432, 'competency_definition', 99, 'tw', '根據醫院願景、現況資源，設定目標，制定醫院發展的決策，規劃系列的行動方案；並能依部屬的能力授予適當權力，清楚說明授權範圍，尊重部屬所做的決策，並適時提供諮詢，以達成醫院的願景與目標。'),
(1433, 'competency_definition', 99, 'cn', ''),
(1434, 'competency_definition', 99, 'en', ''),
(1435, 'competency_definition', 100, 'tw', '能清楚說明團隊目標，提供團隊所需資源與資訊，進行有效分工，促進團隊合作。'),
(1436, 'competency_definition', 100, 'cn', ''),
(1437, 'competency_definition', 100, 'en', ''),
(1438, 'behavior_definition', 64, 'tw', '不預設立場，願意花時間傾聽他人的看法、意見，並能以自身經驗與他人分享以取得共識。'),
(1439, 'behavior_definition', 64, 'cn', ''),
(1440, 'behavior_definition', 64, 'en', ''),
(1441, 'behavior_definition', 65, 'tw', '訊息的傳達能確保對方充分瞭解，並取得雙方的認同。'),
(1442, 'behavior_definition', 65, 'cn', ''),
(1443, 'behavior_definition', 65, 'en', ''),
(1444, 'behavior_definition', 66, 'tw', '能耐心處理、聆聽內外部顧客抱怨，具同理心，不易與人發生衝突。'),
(1445, 'behavior_definition', 66, 'cn', ''),
(1446, 'behavior_definition', 66, 'en', ''),
(1447, 'behavior_definition', 67, 'tw', '懂得忍讓的智慧，並有冷靜處理以避免衝突的能力。'),
(1448, 'behavior_definition', 67, 'cn', ''),
(1449, 'behavior_definition', 67, 'en', '');
INSERT INTO `text` (`term_id`, `term_title`, `depend_on_id`, `term_language`, `text_content`) VALUES
(1450, 'behavior_definition', 68, 'tw', '能以直接溝通來排除問題與障礙，或婉轉誠實的回應他人所傳達的訊息。'),
(1451, 'behavior_definition', 68, 'cn', ''),
(1452, 'behavior_definition', 68, 'en', ''),
(1453, 'behavior_definition', 69, 'tw', '透過不同的機會對內外部顧客，表達自己的友好和善意，能與他人友善和睦的相處。'),
(1454, 'behavior_definition', 69, 'cn', ''),
(1455, 'behavior_definition', 69, 'en', ''),
(1456, 'behavior_definition', 70, 'tw', '會主動關心他人 (部屬/同事) 的近況及需求。'),
(1457, 'behavior_definition', 70, 'cn', ''),
(1458, 'behavior_definition', 70, 'en', ''),
(1459, 'behavior_definition', 71, 'tw', '能運用現有資源建立並維持良好的人際網絡關係。'),
(1460, 'behavior_definition', 71, 'cn', ''),
(1461, 'behavior_definition', 71, 'en', ''),
(1462, 'behavior_definition', 72, 'tw', '遇到困難時，能善用人際網絡有效解決問題。'),
(1463, 'behavior_definition', 72, 'cn', ''),
(1464, 'behavior_definition', 72, 'en', ''),
(1465, 'behavior_definition', 73, 'tw', '願意擔任社團、公學會領導人、理監事等，以培養領導才能及尋求有利於工作推動的人際網絡關係。'),
(1466, 'behavior_definition', 73, 'cn', ''),
(1467, 'behavior_definition', 73, 'en', ''),
(1468, 'behavior_definition', 74, 'tw', '能了解顧客的需求及期望，主動提供服務，以滿足顧客的需求。'),
(1469, 'behavior_definition', 74, 'cn', ''),
(1470, 'behavior_definition', 74, 'en', ''),
(1471, 'behavior_definition', 75, 'tw', '運用人際溝通技巧，以尊重、同理心與顧客建立良好的互動與關係。'),
(1472, 'behavior_definition', 75, 'cn', ''),
(1473, 'behavior_definition', 75, 'en', ''),
(1474, 'behavior_definition', 76, 'tw', '能有效評估顧客的不滿意問題，進行檢討與改善。'),
(1475, 'behavior_definition', 76, 'cn', ''),
(1476, 'behavior_definition', 76, 'en', ''),
(1477, 'behavior_definition', 77, 'tw', '會運用有效的方法來了解、評估病患及其家屬的考量或問題，並能設法滿足病患或家屬的潛在需求。'),
(1478, 'behavior_definition', 77, 'cn', ''),
(1479, 'behavior_definition', 77, 'en', ''),
(1480, 'behavior_definition', 78, 'tw', '能提供滿意的醫療服務，視病猶親，提昇病患或家屬對本院的信任與依賴度。'),
(1481, 'behavior_definition', 78, 'cn', ''),
(1482, 'behavior_definition', 78, 'en', ''),
(1483, 'behavior_definition', 79, 'tw', '會依據事實來行使職權，並對每個成員一視同仁，公平的對待。'),
(1484, 'behavior_definition', 79, 'cn', ''),
(1485, 'behavior_definition', 79, 'en', ''),
(1486, 'behavior_definition', 80, 'tw', '會使用激勵的方法以提昇團隊的士氣或生產力。'),
(1487, 'behavior_definition', 80, 'cn', ''),
(1488, 'behavior_definition', 80, 'en', ''),
(1489, 'behavior_definition', 81, 'tw', '主持會議時，懂得如何讓與會人員的意見相互交流。'),
(1490, 'behavior_definition', 81, 'cn', ''),
(1491, 'behavior_definition', 81, 'en', ''),
(1492, 'behavior_definition', 82, 'tw', '能讓部屬接受領導者的理念、目標或工作分派。'),
(1493, 'behavior_definition', 82, 'cn', ''),
(1494, 'behavior_definition', 82, 'en', ''),
(1495, 'behavior_definition', 83, 'tw', '能建立團隊目標，並帶領部屬完成其工作任務，是個可信賴的領導者。'),
(1496, 'behavior_definition', 83, 'cn', ''),
(1497, 'behavior_definition', 83, 'en', ''),
(1498, 'behavior_definition', 84, 'tw', '能根據現況、資源及醫院價值觀，制定目標、決策，並規劃系列的行動方案。'),
(1499, 'behavior_definition', 84, 'cn', ''),
(1500, 'behavior_definition', 84, 'en', ''),
(1501, 'behavior_definition', 85, 'tw', '能蒐集決策所需資訊，提出各種可能方案，並依據決策標準，考量相關主管、部屬意見，適時選擇有效方案，加以執行。'),
(1502, 'behavior_definition', 85, 'cn', ''),
(1503, 'behavior_definition', 85, 'en', ''),
(1504, 'behavior_definition', 86, 'tw', '能依醫院決策提出方案，並要求所屬單位依據決策標準有效執行，以達成醫院的願景與目標。'),
(1505, 'behavior_definition', 86, 'cn', ''),
(1506, 'behavior_definition', 86, 'en', ''),
(1507, 'behavior_definition', 87, 'tw', '能依部屬的職權範圍授與自我管理的權力，讓他們朝組織目標發展。'),
(1508, 'behavior_definition', 87, 'cn', ''),
(1509, 'behavior_definition', 87, 'en', ''),
(1510, 'behavior_definition', 88, 'tw', '在部屬的授權範圍內，能尊重他人所做的決定，並適時提供諮詢，協助其成長，以達成目標。'),
(1511, 'behavior_definition', 88, 'cn', ''),
(1512, 'behavior_definition', 88, 'en', ''),
(1513, 'behavior_definition', 89, 'tw', '規劃或執行團隊工作時，能從醫院或部門單位的整體利益考量著想。'),
(1514, 'behavior_definition', 89, 'cn', ''),
(1515, 'behavior_definition', 89, 'en', ''),
(1516, 'behavior_definition', 90, 'tw', '能尊重團隊成員意見，支持團隊決定，共同合作達成團隊目標。'),
(1517, 'behavior_definition', 90, 'cn', ''),
(1518, 'behavior_definition', 90, 'en', ''),
(1519, 'behavior_definition', 91, 'tw', '在團隊合作過程中，會主動積極地排除困難，並且提供有益於最後問題解決的方案。'),
(1520, 'behavior_definition', 91, 'cn', ''),
(1521, 'behavior_definition', 91, 'en', ''),
(1522, 'behavior_definition', 92, 'tw', '能視工作需要與其他部門建立良好團隊關係，協同合作，以達成團隊合作的目標。'),
(1523, 'behavior_definition', 92, 'cn', ''),
(1524, 'behavior_definition', 92, 'en', ''),
(1525, 'behavior_definition', 93, 'tw', '能主動提出有助於跨團隊合作衝突的排除或是團隊士氣的激勵方法，以達成組織目標。'),
(1526, 'behavior_definition', 93, 'cn', ''),
(1527, 'behavior_definition', 93, 'en', ''),
(1528, 'competency_definition', 101, 'tw', '能正確同理他人的感受、需要和觀點，並能清楚表達自己的語意讓對方明瞭；以及具備對內、外部顧客的工作說明，以達成團體協作結果的能力。'),
(1529, 'competency_definition', 101, 'cn', ''),
(1530, 'competency_definition', 101, 'en', ''),
(1531, 'competency_definition', 102, 'tw', '能夠運用組織各種相關資源，透過標準作業流程，將策略或計畫有效落實，達到組織既定的目標；有效的管理時間和資源，確保工作有效率的完成。'),
(1532, 'competency_definition', 102, 'cn', ''),
(1533, 'competency_definition', 102, 'en', ''),
(1534, 'competency_definition', 103, 'tw', '整合與管理部屬/同事與自己之間工作關係的互動，並主動維繫與建立對醫院有益的人際網絡。'),
(1535, 'competency_definition', 103, 'cn', ''),
(1536, 'competency_definition', 103, 'en', ''),
(1537, 'competency_definition', 104, 'tw', '能依部屬能力授予適當權力，清楚說明授權範圍，並尊重部屬所做的決定，且適時提供指導。'),
