INSERT INTO `tpl` (`tpl_id`, `tpl_title`, `tpl_sender`, `tpl_content`) VALUES
(3, '360度職能評鑑通知函 (評鑑期限即將到期)', '360 Degree Assessment Administrator', '親愛的 <raterName/>您好：\r\n\r\n由於您還有職能評鑑問卷尚未完成，且評鑑期限即將到期(oo月oo日 星期X)，請您儘快撥空登入 <sysURL/> 填寫問卷，謝謝您！\r\n\r\n您的登入信息如下：\r\n帳號：<raterID/>\r\n密碼：<raterPWD/>\r\n\r\n請注意：當您填寫問卷過程中需暫時離開系統時，請務必點選暫存，以免數據遺失）\r\n\r\n若您在填寫問卷過程當中有任何問題，請洽人資室 崔懷芝。\r\n\r\n謝謝您的參與！\r\n\r\n主管領導力提升專案工作小組 敬上'),
(2, '360度職能評鑑邀請函', '360 Degree Assessment Administrator', '親愛的 <raterName></raterName>您好：\r\n\r\n在您收到這封郵件時，表示您已被邀請參與本次管理職能360度評鑑。\r\n\r\n本次評鑑目的是為了給參與本次評鑑的受評人，提供更明確的管理職能回饋訊息，俾便受評人建立更具針對性的個人發展計畫(IDP)。\r\n\r\n您的真實回饋訊息，對受評人建立IDP至關重要，請依據您日常對受評人的實際觀察，提供客觀、真實的反饋。\r\n\r\n您至少有一份以上的問卷尚待填寫，請登入 <sysURL></sysURL> 填寫問卷，並請您務必在oo月oo日(星期X)下班前，將所有評鑑問卷填寫完畢。\r\n\r\n您的登入信息如下：\r\n帳號：<raterID></raterID>\r\n密碼：<raterPWD></raterPWD>\r\n\r\n請注意：當您填寫問卷過程中需暫時離開系統時，請務必點選暫存，以免數據遺失）\r\n\r\n若您在填寫問卷過程當中有任何問題，請洽人資室 崔懷芝。\r\n\r\n謝謝您的參與！\r\n\r\n主管領導力提升專案工作小組 敬上');
